export default {
  name: "MainNavTop",
  methods: {
    gopath(id) {
      this.$router.push(id);
    },
    noGo() {
      this.$message({
            message: this.$t('NotYetOpen'),
            type: 'warning',
            center: true,
            duration: 1200
        });
    },
    noChou() {
      this.$router.push('/information')
    },
    noChange() {
      this.$router.push('/challengehome')
    },
    goLottery() {
      this.$router.push('/lottery')
    }
  }
};
